            <p style=""color: #ffffff"">
                Каждый класс имеет привязку к расе и полу и имеет индивидуальное дерево навыков. У каждого класса есть уникальный тип энергии, расходуемый при использовании навыков. Вспомогательные классы (такие, как баферы и лекари) разработчики вводить не собираются, исключением является ");
            WriteLiteral(@"новый класс Шай; частично этими навыками будут наделены другие игровые классы. Также нет разделения классов на профессии.
