<div class=""container-fluid"" style=""background-color: #ffffff;"">
    <div class=""row"">
        <div class=""col-lg-12"">
            <h3><b>Разработка</b></h3>
            <p>
                Игру начали разрабатывать в 2010-м году. Закрытое бета-тестирование в Корее было разделено на три этапа. Первый происходил в октябре 2013 года, два других — в апреле и сентябре 2014. В декабре того же года игра вошла в стадию ОБТ (открытого бета-тестирования) и вышла на корейский игровой рынок. ОБТ японской версии игры стартовало 16 мая 2015 года.

                Первое ЗБТ в России прошло с 28 мая по 31 мая 2015, а последнее — с 15 сентября по 21 сентября того же года. И наконец, 12 октября началось открытое бета-тестирование free-to-play сервера. Сервер с ежемесячной подпиской открыт 10 феврал");
            WriteLiteral(@"я 2016. 2 декабря 2015 было установлено первое крупное обновление. В последующих обновлениях были перераспределены получаемый опыт и сила монстров, что существенно усложнило развитие персонажей и вызвало у игроков большое возмущение. 23 декабря того же года было установлено второе крупное обновление.

                Выход английского клиента игры Black Desert состоялся 3 марта 2016 года.
            </p>
        </div>
    </div>
</div>
